import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './index.css';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
const adminRoutes = require('./routes/adminRoutes');
app.use('/api', adminRoutes);
